import React, { Component } from 'react';
import './App.css';
import Layout from './components/Layout';
import AddTodo from './components/AddTodo';

class App extends Component {
  render() {
    return (
      <div className="App">
       <Layout>
         <AddTodo />
      </Layout>
      </div>
    );
  }
}

export default App;
